oshell = Whole.weight.1/Shell.weight,\n","      lenoshell = Length/Shell.weight,\n","      wholeowhole1 = Whole.weight/Whole.weight.1,\n","      heightpshell = Height + Shell.weight,\n","      sexpshell = Sex_F + Shell.weight,\n","      diammshell = Diameter - Shell.weight,\n","      sexmshell = Sex_I - Shell.weight,\n","      diamoshell = Diameter/Shell.weight,\n","      heightshell = Height * Shell.weight,\n","      wholemwhole1 = Whole.weight - Whole.weight.1,\n","      Sex_F = NULL,\n","      Sex_I = NULL,\n","      Sex_M = NULL,\n","      Length = NULL,\n","      Diameter = NULL,\n","      Height = NULL,\n","      Whole.weight = NULL,\n","      Whole.weight.1 = NULL,\n","      Whole.weight.2 = NULL) \n","\n","head(train4)"]},{"cell_type":"markdown","id":"7dc7a058","metadata":{"papermill":{"duration":0.006547,"end_time":"2025-12-04T00:27:39.810899","exception":false,"start_time":"2025-12-04T00:27:39.804352","status":"completed"},"tags":[]},"source":["# Optuna\n","Now it's time to use Optuna to optimize hyperparameters.  I will use XGBoost as an example, but Optuna can also be used with LightGBM and other algorithms."]},{"cell_type":"markdown","id":"05cdc900","metadata":{"papermill":{"duration":0.006712,"end_time":"2025-12-04T00:27:39.824293","exception":false,"start_time":"2025-12-04T00:27:39.817581","status":"completed"},"tags":[]},"source":["First, I'll put the data in XGBoost format.  I'll take the log of the target, since the metric for this competition is RMSLE, not RMSE.  "]},{"cell_type":"code","execution_count":7,"id":"f29f171e","metadata":{"execution":{"iopub.execute_input":"2025-12-04T00:27:39.842059Z","iopub.status.busy":"2025-12-04T00:27:39.840327Z","iopub.status.idle":"2025-12-04T00:27:39.911714Z","shell.execute_reply":"2025-12-04T00:27:39.909714Z"},"papermill":{"duration":0.083665,"end_time":"2025-12-04T00:27:39.914452","exception":false,"start_time":"2025-12-04T00:27:39.830787","status":"completed"},"tags":[]},"outputs":[],"source":["label1 = log(train4$Rings +1)\n","train.xgb <- xgb.DMatrix(label = label1, data = as.matrix(train4[, c(2, 4:14)]))\n","test.xgb = as.matrix(test4[, 2:13])"]},{"cell_type":"markdown","id":"fd3520b9","metadata":{"papermill":{"duration":0.006679,"end_time":"2025-12-04T00:27:39.927823","exception":false,"start_time":"2025-12-04T00:27:39.921144","status":"completed"},"tags":[]},"source":["Next, I'll make an objective function for Optuna.  For each parameter that you want to tune, you can indicate the minimum and maximum values to be searched.  For example, here I tell Optuna to search for the best max_depth between 2 and 70.  If you'd like an integer to be returned, you can use suggest_int, and if you'd like a decimal number, you can use suggest_float."]},{"cell_type":"code","execution_count":8,"id":"63c7f87b","metadata":{"execution":{"iopub.execute_input":"2025-12-04T00:27:39.944954Z","iopub.status.busy":"2025-12-04T00:27:39.943288Z","iopub.status.idle":"2025-12-04T00:27:39.957976Z","shell.execute_reply":"2025-12-04T00:27:39.956141Z"},"papermill":{"duration":0.026379,"end_time":"2025-12-04T00:27:39.960792","exception":false,"start_time":"2025-12-04T00:27:39.934413","status":"completed"},"tags":[]},"outputs":[],"source":["objective <- function(trial) {\n","  train_data = train.xgb\n","  \n","  # Suggest hyperparameters\n","  params <- list(\n","    objective = \"reg:squarederror\",\n","    metric = \"rmsle\",\n","    max_depth = trial$suggest_int('max_depth', 2, 70),\n","    min_child_weight = trial$suggest_int('min_child_weight', 2, 80),\n","    gamma = trial$suggest_float('gamma', 0, 4),\n","    subsample = trial$suggest_float('subsample', .1, .9),\n","    colsample_by_tree = trial$suggest_float('colsample_by_tree', .1, .9),\n","    alpha = trial$suggest_float('alpha', 0, 4),\n","    lambda = trial$suggest_float('lambda', 0, 4)\n","    )\n","  \n","  # Cross-validation\n","  cv_results <- xgb.cv(\n","    params,\n","    train_data,\n","    nfold = 5,\n","    stratified = TRUE,\n","    nround = 100,\n","    early_stopping_rounds = 10\n","  )\n","  \n","  best_score <- min(cv_results[['rmsle-mean']])\n","  return(best_score)\n","}"]},{"cell_type":"markdown","id":"9ec45382","metadata":{"papermill":{"duration":0.006754,"end_time":"2025-12-04T00:27:39.974889","exception":false,"start_time":"2025-12-04T00:27:39.968135","status":"completed"},"tags":[]},"source":["Next, I will create a study and optimize the parameters.  Note that I set n_trials to 10 here in the interest of time, but I would highly recommend setting n_trials to at least 100 for a good CV score."]},{"cell_type":"code","execution_count":9,"id":"01046720","metadata":{"execution":{"iopub.execute_input":"2025-12-04T00:27:39.991887Z","iopub.status.busy":"2025-12-04T00:27:39.990224Z","iopub.status.idle":"2025-12-04T00:37:47.541958Z","shell.execute_reply":"2025-12-04T00:37:47.539993Z"},"papermill":{"duration":607.564464,"end_time":"2025-12-04T00:37:47.545893","exception":false,"start_time":"2025-12-04T00:27:39.981429","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1]\ttrain-rmse:1.302244+0.000411\ttest-rmse:1.302239+0.001429 \n","Multiple eval metrics are present. Will use test_rmse for early stopping.\n","Will train until test_rmse hasn't improved in 10 rounds.\n","\n","[2]\ttrain-rmse:0.919626+0.000453\ttest-rmse:0.919704+0.001257 \n","[3]\ttrain-rmse:0.654426+0.000598\ttest-rmse:0.654568+0.001281 \n","[4]\ttrain-rmse:0.472407+0.000685\ttest-rmse:0.472527+0.001276 \n","[5]\ttrain-rmse:0.349698+0.000501\ttest-rmse:0.349881+0.001361 \n","[6]\ttrain-rmse:0.269118+0.000409\ttest-rmse:0.269339+0.001198 \n","[7]\ttrain-rmse:0.219084+0.000439\ttest-rmse:0.219326+0.001016 \n","[8]\ttrain-rmse:0.189547+0.000383\ttest-rmse:0.189848+0.001221 \n","[9]\ttrain-rmse:0.173056+0.000493\ttest-rmse:0.173433+0.001268 \n","[10]\ttrain-rmse:0.164112+0.000559\ttest-rmse:0.164496+0.001294 \n","[11]\ttrain-rmse:0.159633+0.000443\ttest-rmse:0.160021+0.001455 \n","[12]